/**
 * @export
 * @interface RegisterTenant
 */
export interface RegisterTenant {
    /**
     * Unique code for the tenant
     * @type {string}
     * @memberof RegisterTenant
     */
    TenantCODE: string;
    /**
     * Display name of the tenant organization
     * @type {string}
     * @memberof RegisterTenant
     */
    TenantName: string;
    /**
     * Username for the primary user
     * @type {string}
     * @memberof RegisterTenant
     */
    UserName: string;
    /**
     * Email address of the primary user
     * @type {string}
     * @memberof RegisterTenant
     */
    EmailAddress: string;
    /**
     * Indicates if metered billing is enabled
     * @type {boolean}
     * @memberof RegisterTenant
     */
    IsMeterBillingEnabled: boolean;
    /**
     * Authentication type code (e.g., Microsoft or Form)
     * @type {string}
     * @memberof RegisterTenant
     */
    AuthenticationTypeCODE: string;
    /**
     * Subscription ID assigned to the tenant
     * @type {string}
     * @memberof RegisterTenant
     */
    SubscriptionId: string;
    /**
     * Plan ID associated with the subscription
     * @type {string}
     * @memberof RegisterTenant
     */
    SubscriptionPlanId: string;
    /**
     * Current subscription status
     * @type {string}
     * @memberof RegisterTenant
     */
    SubscriptionStatus: string;
    /**
     * Product code associated with the registration
     * @type {string}
     * @memberof RegisterTenant
     */
    ProductCode?: string;
    /**
     * First name of the user
     * @type {string}
     * @memberof RegisterTenant
     */
    FirstName: string;
    /**
     * Last name of the user
     * @type {string}
     * @memberof RegisterTenant
     */
    LastName: string;
    /**
     * Organization name
     * @type {string}
     * @memberof RegisterTenant
     */
    OrganizationName: string;
    /**
     * User's designation or role
     * @type {string}
     * @memberof RegisterTenant
     */
    Designation: string;
    /**
     * Hashed password for the user
     * @type {string}
     * @memberof RegisterTenant
     */
    PasswordHash: string;
}
